package main

type bird interface {
	fly() string
}

func goToSky(b bird) {
	b.fly()
}

type duck struct {
	something string
}

func (d duck) fly() string {
	return d.something
}

func undertest() {
	for i := 0; i < 100000; i++ {
		d := duck{howToFly}
		goToSky(d)
	}
}

